import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";  // Correct import
import "./Dashboard.css";

const Dashboard = () => {
  const navigate = useNavigate();

  // Ensure user data is correctly loaded
  const [userDetails, setUserDetails] = useState({
    userName: "",
    userId: "",
    role: "",
    email: "",
    phone: "",
    clubs: [],
    events: [],
    resources: [],
  });

  useEffect(() => {
    const storedUserDetails = {
      userName: localStorage.getItem("userName"),
      userId: localStorage.getItem("userId"),
      role: localStorage.getItem("role"),
      email: localStorage.getItem("userEmail"),
      phone: localStorage.getItem("userPhone"),
      clubs: JSON.parse(localStorage.getItem("userClubs")) || [],
      events: JSON.parse(localStorage.getItem("userEvents")) || [],
      resources: JSON.parse(localStorage.getItem("userResources")) || [],
    };

    if (storedUserDetails.userName) {
      setUserDetails(storedUserDetails);
    } else {
      navigate("/login");  // Ensure correct navigation when not logged in
    }
  }, [navigate]);

  const handleLogout = () => {
    localStorage.clear();
    navigate("/login");  // Navigating back to login
  };

  const handleDeleteAccount = () => {
    localStorage.clear();
    navigate("/signup");  // Redirect to signup after deletion
  };

  return (
    <div className="dashboard-container">
      <img src="/logo1.png" alt="Logo" className="logo-img" />
      <p className="logo-caption">University of Chittagong</p>

      <div className="profile-section">
        <div className="profile-info">
          <h2 className="username">{userDetails.userName}</h2>
          <p className="user-id">ID: {userDetails.userId}</p>
          <p className="user-role">Role: {userDetails.role}</p>
          <p className="user-email">Email: {userDetails.email}</p>
          <p className="user-phone">Phone: {userDetails.phone}</p>
          <button className="btn btn-info">View Profile</button>
        </div>

        <div className="top-right-buttons">
          <button className="btn btn-danger" onClick={handleDeleteAccount}>
            Delete Account
          </button>
          <button className="btn btn-warning" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </div>

      <h1 className="dashboard-title">
        <span className="highlight">CSECU ASSOCIATION</span>
      </h1>
      <h2 className="dashboard-title1">
        Welcome to the <span className="highlight">Digital Frontier</span> – it’s time to explore
      </h2>

      <div className="button-group">
        <div className="card" onClick={() => navigate("/clubs")}>
          <img src="/club.jpg" alt="Clubs" className="card-img" />
          <div className="card-overlay">
            <button className="btn btn-primary">View All Clubs</button>
          </div>
        </div>
        <div className="card" onClick={() => navigate("/events")}>
          <img src="/event.jpg" alt="Events" className="card-img" />
          <div className="card-overlay">
            <button className="btn btn-secondary">View All Events</button>
          </div>
        </div>
        <div className="card" onClick={() => navigate("/resources")}>
          <img src="/re.jpg" alt="Resources" className="card-img" />
          <div className="card-overlay">
            <button className="btn btn-success">View All Resources</button>
          </div>
        </div>
        <div className="card" onClick={() => navigate("/share-thought")}>
          <img src="/share-thoughts.jpg" alt="Share Thoughts" className="card-img" />
          <div className="card-overlay">
            <button className="btn btn-info">Share Your Thoughts</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
